const OrderListComponent = ({ orderList, deleteItem }) => {
    return (
        <ul>
            {orderList.map((item, index) => (
                <li key={index}>
                    {item}
                    <button onClick={() => deleteItem(index)}>Delete</button>
                </li>
            ))}
        </ul>
    );
};
export default OrderListComponent;
